import * as React from 'react';
import './App.css';
import {PokemonList} from "./component/PokemonList";
import {Pokemon} from "./model/Pokemon";

function App() {
    let pokemonList: Pokemon[] = []
    let pikachu: Pokemon = {
        name: "Pikachu",
        weight: 15,
        height: 10,
        id: 1,
        types: []
    }
    pokemonList.push(pikachu)

    return (
        <div className="App">
            <body>
            <PokemonList pokemonList={pokemonList}/>
            </body>
        </div>
    );
}

export default App;
